var Logs={init:function(){Logs.connectWS(),Logs.more()},connectWS:function(){Logs.ws=new WebSocket(logsChannelURL),Logs.ws.onopen=function(){console.log("Connected to logs channel websocket.")},Logs.ws.onmessage=function(o){var s=JSON.parse(o.data);if("simple"===s.type)Logs.prependLog(s.key1,s.key2,s.key3,s.data)},Logs.ws.onclose=function(){console.log("Disconnected to logs channel websocket.")},Logs.ws.onerror=function(o){console.log("ERROR",o)}},appendLog:function(o,s,e,n){let a=Logs.sumResult(o,s,e,n);$("#logsContent").append(a)},prependLog:function(o,s,e,n){let a=Logs.sumResult(o,s,e,n);$("#logsContent").prepend(a)},sumResult:function(o,s,e,n){let a="";switch(e){case"增加积分":a='<div style="padding: 5px 0;font-size: 15px;">',a+='【 <span style="color: #696969">'+o+"</span> ",a+='<span style="color: #708090">'+s+"</span> 】<br>",a+='「<span style="color: #99CC66">(add)'+e+"</span>」 ",a+='<span style="color: #1E90FF">'+n+"</span> ",a+="</div>";break;case"扣除积分":a='<div style="padding: 5px 0;font-size: 15px;">',a+='【 <span style="color: #696969">'+o+"</span> ",a+='<span style="color: #708090">'+s+"</span> 】<br>",a+='「<span style="color: #FF6666">(reduce)'+e+"</span>」 ",a+='<span style="color: #1E90FF">'+n+"</span> ",a+="</div>";break;case"发送弹幕":a='<div style="padding: 5px 0;font-size: 15px;">',a+='【 <span style="color: #696969">'+o+"</span> ",a+='<span style="color: #708090">'+s+"</span> 】<br>",a+='「<span style="color: #FF9900">(post)'+e+"</span>」 ",a+='<span style="color: #1E90FF">'+n+"</span> ",a+="</div>";break;default:a='<div style="padding: 5px 0;font-size: 15px;">',a+='【 <span style="color: #696969">'+o+"</span> ",a+='<span style="color: #708090">'+s+"</span> 】<br>",a+='「<span style="color: #6A5ACD">(handle)'+e+"</span>」 ",a+='<span style="color: #1E90FF">'+n+"</span> ",a+="</div>"}return a},page:1,more:function(){$.ajax({url:Label.servePath+"/logs/more?page="+Logs.page+"&pageSize=30",type:"GET",async:!1,success:function(o){if(0===o.code){let s=o.data;0===s.length?$("#loadMoreBtn").html("没有更多内容了"):s.forEach((o=>{Logs.appendLog(o.key1,o.key2,o.key3,o.data)}))}}}),Logs.page++}};$(document).ready((function(){Logs.init()}));